text:
Since getting to know Jaehyun Doyoung and Jungwoo, I have felt how tired they are mentally, physically, and mentally to achieve their dreams for themselves and for the ones they love and they still do it for their dreams and for their loved ones and fans.  I hope everyone knows that they are tired and went through circumstances we don't know.  I hope  just gives them the love they deserve .

I want to tell you, guys , that this effort of yours will not go for nothing, and if there is nothing left but me, I will support you for your creativity that deserves more than just moral support, but this is what I can do so far.  I’cant wait for the upcoming .Fighting DJJ 💪🏻 

@JAR
